script:
reset();

const size = 64;
const maxTerrainHeight = 32;
const maxHeight = 80;
const origin = { x: size * -0.5, z: size * -0.5 };
//const seed = Math.floor(Math.random() * (2 ** 32));
const seed = 1724858573;
console.log(`seed: ${seed}`);
const simplex = new SimplexNoise(seed);

const map = new Uint8Array(size * maxHeight * size);

const trunk = 3;
const leaves = 2;
const voxelNeighbors = [
  { x: 1, y: 0, z: 0 },
  { x: -1, y: 0, z: 0 },
  { x: 0, y: 0, z: 1 },
  { x: 0, y: 0, z: -1 },
  { x: 0, y: 1, z: 0 },
  { x: 0, y: -1, z: 0 },
];
const tree = (
  position,
  height,
  radius
) => {
  const branches = height + radius * 0.5;
  const queue = [position];
  while (queue.length) {
    const {
      x,
      y,
      z,
      distance = 0,
    } = queue.shift();
    if (y < 0 || y >= maxHeight) {
      return;
    }
    const isTrunk = distance < height;
    update(origin.x + x, y, origin.z + z, (isTrunk || distance < branches) ? trunk : leaves);
    const pushNeighbor = (offset) => {
      const nx = x + offset.x;
      const ny = y + offset.y;
      const nz = z + offset.z;
      if (
        nx >= 0 && nx < size
        && nz >= 0 && nz < size
        && !map[nx * size * maxHeight + ny * size + nz]
      ) {
        queue.push({
          x: nx,
          y: ny,
          z: nz,
          distance: distance + 1,
        });
        return true;
      }
      return false;
    };
    if (isTrunk) {
      pushNeighbor({ x: 0, y: 1, z: 0 });
    } else if (distance === height) {
      voxelNeighbors.forEach((offset) => {
        if (offset.y !== -1) {
          pushNeighbor(offset);
        }
      });
    } else if (distance < (height + radius)) {
      let count = 0;
      const neighbors = voxelNeighbors.length;
      for (let i = 0; i < neighbors; i += 1) {
        const neighbor = voxelNeighbors[
          Math.floor(
            Math.abs(simplex.noise3D((x + i) * 2, (y - i) / 2, (z + i) * 2)) * neighbors
          )
        ];
        if (pushNeighbor(neighbor)) {
          count += 1;
          if (count >= 2) {
            break;
          }
        }
      }
    }
  }
};

box(origin.x - 1, 0, origin.z - 1, size + 2, maxHeight, size + 2, 4);
box(origin.x, 0, origin.z, size, maxHeight, size, 0);

for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < maxTerrainHeight; y += 1) {
    for (let z = 0; z < size; z += 1) {
      const height = Math.floor(
       (
          Math.abs(simplex.noise3D(x / 32, y / 24, z / 32)) * 0.3
          +  Math.abs(simplex.noise3D(x / 64, y / 48, z / 64)) * 0.3
          +  Math.abs(simplex.noise3D(x / 128, y / 64, z / 128)) * 0.4
        ) * maxTerrainHeight
      );
      map[x * size * maxHeight + y * size + z] = y <= height;
    }
  }
}

for (let x = 0; x < size; x += 1) {
  for (let y = 0; y < maxHeight; y += 1) {
    for (let z = 0; z < size; z += 1) {
      if (map[x * size * maxHeight + y * size + z]) {
        const top = y === (maxHeight - 1) || !map[
          x * size * maxHeight + (y + 1) * size + z
        ];
        const type = top ? 1 : 5;
        if (top && simplex.noise3D(x / 8, y / 4, z / 8) > 0.6) {
          if (simplex.noise3D(y / 8, x / 4, z / 8) > -0.5) {
            update(origin.x + x, y + 1, origin.z + z, 6);
          } else {
            const n = Math.abs(simplex.noise2D(z / 8, x / 8));
            const h = 5 + Math.floor(Math.abs(simplex.noise2D(x / 2, z / 2)) * 16);
            const r = 7 + Math.floor(n * h * 0.5);
            tree({x, y, z}, h, r);
          }
        }
        update(origin.x + x, y, origin.z + z, type);
      }
    }
  }
}

const hole = {
  origin: {
    x: -16,
    y: 0,
    z: -24,
  },
  size: {
    x: 32,
    y: 12,
    z: 32,
  },
};
box(
  hole.origin.x, hole.origin.y, hole.origin.z,
  hole.size.x, hole.size.y, hole.size.z,
  4
);
box(
  hole.origin.x + 1, hole.origin.y, hole.origin.z + 1,
  hole.size.x - 2, maxHeight, hole.size.z - 2,
  0
);
const elevator = {
  x: hole.origin.x + hole.size.x * 0.5 - 3,
  y: hole.origin.y,
  z: hole.origin.z + hole.size.z,
};
box(
  elevator.x, elevator.y, elevator.z,
  6, 7, 6,
  4
);
box(
  elevator.x + 1, elevator.y + 1, elevator.z + 1,
  4, 5, 4,
  0
);
